import React from "react";
class ExpenseEntryItem extends React.Component {
    
    render() {
        inlineStyle = {
            color:'white',
            backgroundColor:'grey',
            fontSize:'15px'
        }
        return(
            <div>
                <section id="cards" style={this.inlineStyle}>
                    <div><b>Item:</b><em>Mango Juice</em></div>
                    <div><b>Spent:</b><em>Rs.30</em></div>
                    <div><b>Date:</b><em>2022-11-21</em></div>
                    <div><b>Category:</b><em>Food & Beverages</em></div>
                </section>  
            </div>
        )
    }
}

export default ExpenseEntryItem
